import React from 'react';
import classes from '../../ComplexNumber/Page/index.module.css';
import llrh from '../Lib/llrh.jpg';
import bbw from '../Lib/bbw.jpg';
import leaving from '../Lib/leaving.jpg'
import {AskQuestion} from "../Component/ask-question";
import {MDBBtn, MDBCol, MDBRow} from "mdbreact";
import {SpeakRecogAnylysis} from "../../ComplexNumber/SpeakModuleAnalysis";
export class End extends React.Component {
    constructor(props) {
        super(props);
        this.state = {

        };

    }
    myClick=(text)=>{
        alert(text);
    }

    render() {
        return (
            <div className={`${classes.body} align-content-center w-100 h-100 text-center`}>
                <AskQuestion/>
                <div className="d-flex align-items-baseline justify-content-center">
                    <div className={classes.title1}>
                        Analysis
                    </div>
                </div>
                <MDBRow>
                    <MDBCol size="3">

                    </MDBCol>
                    <MDBCol size="6">
                        <div className={classes.ph}>
                            This page will assess the student to determine their proficiency at various topics of knowledge in this module, and adjust its knowledge model based on it.
                        </div>
                        <br/>

                        <div className={classes.border} style={{borderWidth:'1px'}}>

                            <p className={classes.ph2} style={{fontSize:'40px'}}>
                                What is the format of a dividing complex numbers problem?
                            </p>

                            <div className="flex-grow-1 px-3">
                                {/*<input*/}
                                {/*placeholder="Enter your response here"*/}
                                {/*style={{*/}
                                {/*borderStyle:'solid',*/}
                                {/*borderWidth:'1px',*/}
                                {/*borderColor:'#33b5e5',*/}
                                {/*borderRadius:'15px',*/}
                                {/*fontFamily:'\'Rajdhani\', sans-serif',*/}
                                {/*fontSize:'30px',*/}
                                {/*width:'100%'*/}
                                {/*}}*/}
                                {/*/>*/}
                                <SpeakRecogAnylysis/>
                            </div>
                            <br/>
                        </div>

                        <br/>
                    </MDBCol>
                </MDBRow>
                <div style={{padding:'50px 0 250px 0'}}>
                    {/*<div>*/}
                        {/*<img className="py-2 my-3" src={leaving} alt="village" width="600" height="400"/>*/}
                    {/*</div>*/}
                    {/*/!*<p className="red-text">*!/*/}
                        {/*Lack end.jpg*/}
                    {/*</p>*/}

                    <div
                        onClick={() => {this.props.history.goBack();}}
                        className={classes.a}>&laquo; Previous
                    </div>
                    <div
                        onClick={() => {this.props.history.push('/rrh/cover');}}
                        className={classes.a}>Again &raquo;
                    </div>

                </div>

            </div>
        );
    }
}
